import * as React from "react";
import Footer from "./components/footer";
import Navbar from "./components/Navbar";
import Tentang from "./components/tentang";
// import Pelatihan from "./Pages/Pelatihan";

function App() {
  return (
    <div>
      <Navbar />
      <div>
        <Tentang />
      </div>
      <Footer />
    </div>
  );
}

export default App;
